import React, { Component } from "react";

class SaveList extends Component {
    constructor(props) {
        super(props);
        
        this.state = {
            videos: [],
            video: null,
        }
    }
    

    render() {
        return (
            <div className='container'>
                <div className='row'>
                    <div className='col'>
                        <ul className='list-group'>
                            <li key={1} className='list-group-item'>
                                <div className='row'>
                                    <div className='col'>저장 제목</div>
                                    <div className='col-auto'>
                                        <input type='button' value='View' className='btn btn-info btn-sm'></input>
                                        <input type='button' value='Delete' className='btn btn-danger btn-sm'></input>
                                    </div>
                                </div>
                            </li>
                        </ul>
                    </div>
                </div>
            </div>
        );
    }
}

export default SaveList;
